import React, {Component} from 'react';
import grades from '../mock-data/grades.json';
import GridDetail from './gridDetail';

class Grid extends Component {
    render() {
        return (
            <div>
                {grades.map((studentItem, index)=>{
                    return <GridDetail grid={studentItem}/>
                })}
            </div>
        )
            }
}
export default Grid;
